import Ember from 'ember';

export default Ember.Service.extend({
    items: null,
    init() {
        this._super(...arguments);
        /* Load the items from database using REST API */
        this.set('items', [
            {
                model: 'Philips GC1905 Steam Iron, 1440 W',
                description: 'Steam + 1440 W Power Consumption + Spray Iro + Self Cleaning Featur + 1.8 m Cord Lengt + Variable Steam Contro + 180 Degree Swivel Cord. Save time on household chores while you use Philips GC1905 iron which is built to perfection so as to give you a quick ironing experience.',
                files: [{
                    dataURL: 'data:image/jpeg;base64,'
                }, {
                    dataURL: 'data:image/jpeg;base64,'
                }, {
                    dataURL: 'data:image/jpeg;base64,'
                }]
            },
            {
                model: 'Eveready HL 67 Emergency Lights',
                description: 'Ni-MH Battery + Power On Indicator + Built-in Deep Discharge + LED Light + Overcharge Protection + 12 LED\'s. Maintenance free rechargeable lantern with power on indicator. Plug it into an outlet and it automatically turns on when the power goes out. Built In deep discharge and overcharge protection. Warranty: 6 months on product. Operating Voltage: 210-230 volts. Includes: Portable light and Charging cord. NiMH battery with 500 Recharge cycle life.',
                files:[{
                    dataURL: 'data:image/png;base64,'
                }, {
                    dataURL: 'data:image/jpeg;base64,'
                }]
            }
        ]);
    },
    /* Property to hold the New Appliance data */
    newItem: {
        model: null,
        description: null,
        files: []
    },
    setNewItemFile(file) {
        this.get('newItem').files.pushObject(file);
    },
    /* Clear the New Appliance data */
    clearNewItem() {
        this.set('newItem', {
            model: null,
            description: null,
            files: []
        });
    },
    /* Add new appliance to database using REST API */
    addNewItem(appliance) {
        this.get('items').insertAt(0, appliance);
    }
});
